    return (
        <div className="col-md-6 mb-2">
        <div className="card">
            <div className="card-body d-flex justify-content-between">
            <div>
                <h2 className="card-title">
                {/* {c.name} {c.lastname} */}
                </h2>
                {/* <p className="card-text">{c.mail}</p> */}
            </div>
            </div>
        </div>
        </div>
    );
}

export default ContactosCard;
